import React from 'react';
import { Worker, Viewer } from '@react-pdf-viewer/core';
import { defaultLayoutPlugin } from '@react-pdf-viewer/default-layout';
import '@react-pdf-viewer/core/lib/styles/index.css';
import '@react-pdf-viewer/default-layout/lib/styles/index.css';
import '../container/pythonContent.css'; // Correct CSS import path

function PythonContent() {
  // Define PDF file paths
  const pdfFiles = [
    '/videos/cv.pdf',
    '/videos/cv.pdf', // Add more PDF file paths here if needed
  ];

  const renderPdfViewer = (pdfPath) => (
    <div className="pdf-viewer-container">
      <Worker workerUrl="/videos/cv.pdf.worker.min.js"> {/* Ensure you have pdf.worker.min.js in your public folder */}
        <Viewer fileUrl={pdfPath} />
      </Worker>
    </div>
  );

  return (
    <div className='python-content'>
      <div className='python-video-section'>
        {/* Your video content */}
      </div>
      <div className='python-material-section'> 
        <p>Python Study Material</p>  
        <div className='notes'>
          {pdfFiles.map((pdfPath, index) => (
            <div key={index} className='notes_pdf'>
              {renderPdfViewer(pdfPath)}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default PythonContent;
